remain.bigcartel.com\n\nCredits:\nGuest Vocals by Cameron McBride Of Methwitch\nInstruments by Vincent Lugo\nRecorded by Randy Pasquarella @ Pasquarella Recordings\nArtwork by Vincent Lugo\nVideo by Malevolent Media\n\nLyrics:\ndeath’s hand.\nit's hard getting out of bed. \ntrying to find that motivation to even get me up. \nall i feel is a constant dread that leaves me in shambles. \nall i feel is a constant weight that won't get off my chest. \nit keeps me down. \nit steals the air from my lungs.\nso i lay there. \nconsistently struggling. \nstruggling to breathe. \nconsistently in the same position. \ni've lost all motivation i once had. \nfighting for nothing.\nfighting for nothing. \nwhat's the point of living a hollow existence? \nscratching and clawing towards an exit. \ni wish to see death's hand in front of me. \nso i may take hold and let it take me away. \ni wish to see death's hand in front of me. \nso i may take hold and let it take me away. \n\nSLAM WORLDWIDE:\nEmail: contact@slamworldwide.net\nWebsite: http://www.slamworldwide.net\nFacebook Page: https://www.facebook.com/slamworldwideofficial\nFacebook Group: https://www.facebook.com/groups/slamworldwideofficial\nInstagram: http://instagram.com/slamworldwide\nTwitter: https://twitter.com/slam_worldwide\nBig Cartel: http://slamworldwide.bigcartel.com\n\n℗ \u0026 © 2020 no souls remain\nAll rights reserved.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/mA23K_3R5tM/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAgXiTYSLOmlrepm8Yy2RikxCaWHQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/mA23K_3R5tM/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLD79bv7dcVgIck4xwNIoicU7-fvgg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/mA23K_3R5tM/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAfel39wl1lnbG6JmQgRpN6fwguxA","width":246,"height":13
